import Link from 'next/link'

const Index = () => {
    return (
        <>
            <nav style = {{display: 'inline-block',margin:200}}>
                <Link href={'/'}><a>Home</a></Link>
                <Link href={'/details'}><a>Skills Details</a></Link>
            </nav>
                <h1>My Dev Skills</h1>
        </>
    )
}

export default Index;
